const e=JSON.parse('{"key":"v-5d45561c","path":"/pages/c35c5f/","title":"as-if-serial&happens-before","lang":"zh-CN","frontmatter":{"title":"as-if-serial&happens-before","date":"2023-05-26T15:19:03.000Z","permalink":"/pages/c35c5f/","author":{"name":"江"},"category":["并发编程"],"description":"as-if-serial as-if-serial语义的意思是：不管怎么重排序（编译器和处理器为了提高并行度），（单线程）程序的执行结果不能被改变。编译器、runtime和处理器都必须遵守as-if-serial语义。 为了遵守as-if-serial语义，编译器和处理器不会对存在数据依赖关系的操作做重排序，因为这种重排序会改变执行结果。但是，如果操作之间不存在数据依赖关系，这些操作就可能被编译器和处理器重排序。 double pi = 3.14; // A double r = 1.0; // B double area = pi * r * r; // C","head":[["meta",{"property":"og:url","content":"https://mister-hope.github.io/pages/c35c5f/"}],["meta",{"property":"og:site_name","content":"学习笔记"}],["meta",{"property":"og:title","content":"as-if-serial&happens-before"}],["meta",{"property":"og:description","content":"as-if-serial as-if-serial语义的意思是：不管怎么重排序（编译器和处理器为了提高并行度），（单线程）程序的执行结果不能被改变。编译器、runtime和处理器都必须遵守as-if-serial语义。 为了遵守as-if-serial语义，编译器和处理器不会对存在数据依赖关系的操作做重排序，因为这种重排序会改变执行结果。但是，如果操作之间不存在数据依赖关系，这些操作就可能被编译器和处理器重排序。 double pi = 3.14; // A double r = 1.0; // B double area = pi * r * r; // C"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-08-01T18:24:48.000Z"}],["meta",{"property":"article:author","content":"江"}],["meta",{"property":"article:published_time","content":"2023-05-26T15:19:03.000Z"}],["meta",{"property":"article:modified_time","content":"2023-08-01T18:24:48.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"as-if-serial&happens-before\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-05-26T15:19:03.000Z\\",\\"dateModified\\":\\"2023-08-01T18:24:48.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"江\\"}]}"]]},"headers":[{"level":2,"title":"as-if-serial","slug":"as-if-serial","link":"#as-if-serial","children":[]},{"level":2,"title":"happens-before","slug":"happens-before","link":"#happens-before","children":[]}],"git":{"createdTime":1690914288000,"updatedTime":1690914288000,"contributors":[{"name":"jiangqingdong","email":"thejqd@gmail.com","commits":1}]},"readingTime":{"minutes":6.89,"words":2067},"filePathRelative":"10.并发编程/02.as-if-serial&happens-before.md","localizedDate":"2023年5月26日","excerpt":"<h2> as-if-serial</h2>\\n<p>as-if-serial语义的意思是：<strong>不管怎么重排序（编译器和处理器为了提高并行度），（单线程）程序的执行结果不能被改变。编译器、runtime和处理器都必须遵守as-if-serial语义。</strong></p>\\n<p>为了遵守as-if-serial语义，编译器和处理器不会对存在数据依赖关系的操作做重排序，因为这种重排序会改变执行结果。但是，如果操作之间不存在数据依赖关系，这些操作就可能被编译器和处理器重排序。</p>\\n<div class=\\"language-java line-numbers-mode\\" data-ext=\\"java\\"><pre class=\\"language-java\\"><code><span class=\\"token keyword\\">double</span> pi <span class=\\"token operator\\">=</span> <span class=\\"token number\\">3.14</span><span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// A</span>\\n<span class=\\"token keyword\\">double</span> r <span class=\\"token operator\\">=</span> <span class=\\"token number\\">1.0</span><span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// B</span>\\n<span class=\\"token keyword\\">double</span> area <span class=\\"token operator\\">=</span> pi <span class=\\"token operator\\">*</span> r <span class=\\"token operator\\">*</span> r<span class=\\"token punctuation\\">;</span> <span class=\\"token comment\\">// C</span>\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>","autoDesc":true}');export{e as data};
